import React from 'react';
import './App.css';
import root from './index.js';
import getCookie from './App';

function exit() {
    document.cookie = "jwt=" + " " + ";max-age=0";
    window.location.reload();
}

function Profile() {
    const request = new XMLHttpRequest();

    const url = "http://localhost:8080/profile";

    const params = "accessToken=" + getCookie("jwt");

    request.open("GET", url, true);

    request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

    request.addEventListener("readystatechange", () => {
        if (request.readyState === 4 && request.status === 200) {
            //document.cookie = "jwt=" + request.getResponseHeader("Authorization") + ";max-age=3600";
            //console.log(request.getResponseHeader("Authorization"));
            //root.render(<SetUserPage ans={request.status} anst={request.responseText} />)
            console.log(request.responseText);
        }
    });

    request.send(params);

    if(request.responseText === "True") {
        return (
            <div className="Profile">
                <p>Ваш профиль</p>
                <p>Поиск людей</p>
                <p>Друзья</p>
                <p>Чаты</p>
                <p onClick={exit} >Выйти</p>
            </div>
        );
    } else {
        console.log("Error");
    }
}

export default function setProfile() {
    root.render(<Profile />)
}
